#!/bin/sh

echo "Updating and installing Docker"
sudo yum update -y
sudo yum upgrade -y
sudo yum remove docker \
  docker-client \
  docker-client-latest \
  docker-common \
  docker-latest \
  docker-latest-logrotate \
  docker-logrotate \
  docker-engine
sudo yum install -y yum-utils \
  device-mapper-persistent-data \
  lvm2
sudo yum-config-manager -y \
    --add-repo \
    https://download.docker.com/linux/centos/docker-ce.repo
sudo yum install -y docker-ce docker-ce-cli containerd.io

echo "Starting and enabling Docker"
sudo systemctl start docker
sudo systemctl enable docker

echo "Configure database user"
read -p "Postgres user name: " name
read -s -p "Postgres user password: " password

export POSTGRES_USER=$name
export POSTGRES_PASSWORD=$password

sudo docker rm --force postgres || true

echo "Creating database container (and seed 'reviews' database)"
sudo docker run -d \
  --name postgres \
  -e POSTGRES_USER=$POSTGRES_USER \
  -e POSTGRES_PASSWORD=$POSTGRES_PASSWORD \
  -e POSTGRES_DB=reviews \
  -p 81:5432 \
  -p 5432:5432 \
  -p 6080:5432 \
  --restart always \
  postgres:11.3-alpine

sleep 20 # Ensure enough time for postgres database to initialize and create role

sudo docker exec -i postgres psql -U $POSTGRES_USER -d reviews <<-EOF
create table products (
    id SERIAL PRIMARY KEY,
    name VARCHAR(50) UNIQUE NOT NULL,
    level INTEGER NOT NULL,
    published BOOLEAN NOT NULL DEFAULT false,
    created_on TIMESTAMP NOT NULL DEFAULT NOW()
);
alter table products ADD CONSTRAINT level_check CHECK (
    level >= 0
    AND level <= 2
);
create table reviews (
    id SERIAL PRIMARY KEY,
    product_id INTEGER REFERENCES products(id),
    rating INTEGER NOT NULL,
    comment TEXT,
    created_on TIMESTAMP NOT NULL DEFAULT NOW()
);
alter table reviews add constraint rating_check CHECK (
    rating > 0
    AND rating <= 5
);
